	add("popslash", "{\"term\":\"popslash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|pop|slash|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"slash Slash fan fiction which pairs pop pop musicians, especially ones belonging to the same boy band\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Kristina Busse, \u0026quot;\u0027I\u0027m jealous of the fake me\u0027: Postmodern subjectivity and identity construction in boy band fan fiction\u0026quot;, in \u0027Framing Celebrity: New Directions in Celebrity Culture\u0027 (eds. Su Holmes \u0026amp; Sean Redmond), Routledge (2006), ISBN 0415377099, [http://books.google.com/books?id\u003dQbCNJZZrj24C\u0026amp;pg\u003dPA254\u0026amp;dq\u003d%22popslash%22 page 254\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Popslash\u0027\u0027 writers use pop stars as their protagonists, constructing fictional narratives that supplement and enhance those disseminated by the media\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Francesca Coppa, \u0026quot;A Brief History of Media Fandom\u0026quot;, in \u0027Fan Fiction and Fan Communities in the Age of the Internet: New Essays\u0027 (eds. Karen Hellekson \u0026amp; Kristina Busse), McFarland \u0026amp; Company (2006), ISBN 9780786426409, [http://books.google.com/books?id\u003dUgZsi_DOKoQC\u0026amp;pg\u003dPA56\u0026amp;dq\u003d%22popslash%22 page 56\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Consequently, \u0027\u0027popslash\u0027\u0027 grew popular among media fan writers, many of whom created similarly brilliant and science fiction-like premises to explore celebrity culture as a metaphor for gender identity and other performances of the self\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Katherine Meizel, \u0027Idolized: Music, Media, and Identity in American Idol\u0027, Indiana University Press (2011), ISBN 9780253355713, [http://books.google.com/books?id\u003d_yjm2JzumkcC\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22popslas\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22popslash\u0026amp;f\u003dfalse page 46\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027popslash\u0027\u0027 phenomenon gathered momentum after a 2001 story that imagined Chris Kirkpatrick of the band \u0027N Sync experiencing a sudden overnight gender change\", \"priority\":8}]}, \"synonyms\":{}}");

