	add("popularity", "{\"term\":\"popularity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|popularitas||an effort to please the people}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being popular; especially, the state of being esteemed by, or of being in favor with, the people at large; good will or favor proceeding from the people; as, the popularity of a law, statesman, or a book\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being adapted or pleasing to common, poor, or vulgar people; hence, cheapness; inferiority; vulgarity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This gallant laboring to avoid \u0027\u0027popularity\u0027\u0027 falls into a habit of affectation.\u0027 \u0026amp;mdash; Ben Jonson\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something which obtains, or is intended to obtain, the favor of the vulgar; claptrap\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Popularities\u0027\u0027, and circumstances which sway the ordinary judgment.\u0027 \u0026amp;mdash; Bacon\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The act of courting the favour of the people\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Indicted for \u0027\u0027popularity\u0027\u0027 and ambition.\u0027 \u0026amp;mdash; Holland\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Public sentiment; general passion\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A little time be allowed for the madness of \u0027\u0027popularity\u0027\u0027 to cease.\u0027 \u0026amp;mdash; Bancroft\", \"priority\":9}]}, \"synonyms\":{}}");

	add("population", "{\"term\":\"population\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027populatio\u0027 (a people, multitude) as if a noun of action from Classical Latin \u0027populus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The people living within a political or geographical boundary\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"By extension, the people with a given characteristic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A count of the number of residents within a political or geographical boundary such as a town, a nation or the world\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A collection of organisms of a particular species, sharing a particular characteristic of interest, most often that of living in a given area\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dPlant breeding is always a numbers game.The wild species we use are rich in genetic variation,\u0026amp;nbsp;[\u0026amp;hellip;]. In addition, we are looking for rare alleles, so the more plants we try, the better. These rarities may be new mutations, or they can be existing ones that are neutral—or are even selected against—in a wild \u0027\u0027population\u0027\u0027. A good example is mutations that disrupt seed dispersal, leaving the seeds on the heads long after they are ripe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A group of units (persons, objects, or other items) enumerated in a census or from which a sample is drawn\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, et al., \u0027Final Report of the Anthropometric Committee\u0027, Report of the British Association for the Advancement of Science, [http://galton.org/cgi-bin/searchImages/galton/search/essays/pages/galton-1883-rba-anthro-report-final_14.htm p. 269\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"it is possible it [the Anglo-Saxon race] might stand second to the Scandinavian countries [in average height] if a fair sample of their \u0027\u0027population\u0027\u0027 were obtained\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The act of filling initially empty items in a collection\", \"priority\":9}]}, \"synonyms\":{}}");

